    }

      border: 0 !important;
    }

      overflow: visible !important;

    }

    }

      position: relative;
      padding-left: 16px;
    }

      padding-left: 5px;
      /* display: block!important; */
    }

    .el-tree-node :last-child:before {
      height: 30px;
    }

      border-left: none;
    }

      border-top: none;
    }

      content: "";
      left: -4px;
      position: absolute;
      right: auto;
      border-width: 1px;
    }

    .el-tree-node:after {
      content: "";
      left: -5px;
      position: absolute;
      right: auto;
      border-width: 1px;
    }

    .tree :first-child .el-tree-node:before {
      border-left: none;
    }

      height: 100%;

      width: 1px;
    }

      height: 20px;
      top: 17px;
      width: 20px;
    }

    .el-tree-node__content {
      padding-left: 10px !important;
      margin-left: -28px;
      font-size: 14px;
    }

      padding: 10px;
      font-size: 16px;
      position: relative;
      left: 9px;
      color: #1A1A1A;
    }

    .el-tree-node__expand-icon.is-leaf {
      color: transparent
    }

    .el-tree-node>.el-tree-node__children {
      overflow: unset !important;
